import type { ReactNode } from 'react';
import { forwardRef } from 'react';

interface CarouselProps {
  children: ReactNode;
  className?: string;
  snap?: ScrollLogicalPosition;
}

const CarouselItem = forwardRef(function MyComponent(
  { children, className, snap }: CarouselProps,
  ref: React.Ref<HTMLDivElement>,
) {
  return (
    <div ref={ref} className={`snap-${snap} ${className} carousel_item`}>
      {children}
    </div>
  );
});

export { CarouselItem };
